import React, {Component} from 'react';
import NameFormComponent from './NameFormComponent';
import AddressFormComponent from './AddressFormComponent';
import ZipFormComponent from './ZipFormComponent';
import ContactNumberFormComponent from './ContactNumberFormComponent';
import MemberCountFormComponent from './MemberCountFormComponent';
import DobFormComponent from './DobFormComponent';
import HousingTypeFormComponent from './HousingTypeFormComponent';
import '../../App.css';
import Utils from '../../Utils/Util';
import {ajaxPost} from '../../Services/Http/Ajax';
import * as constants from '../../Utils/Constants'
import * as urls from '../../Utils/Urls'
import Jumbotron from 'react-bootstrap/Jumbotron';
import Container from 'react-bootstrap/Container';
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';
import MenuComponent from '../General/MenuComponent';
import FooterComponent from '../General/FooterComponent';
// import './Style/Style.css';



class FamilyContainer extends Component {
    constructor(props) {

        super(props);
    }


    handleSubmit = (e) => {
        let nameData=[];
        e.preventDefault();
        let familyDetails = {
            nameData: this.state.nameData,
            addressData: this.state.addressData,
            memberCountData: this.state.memberCountData,
            dobData: this.state.dobData,
            zipData: this.state.zipData,
            contactData: this.state.contactData,
            housingData: this.state.housingData

        };

        if(familyDetails) {
            let uri = urls.API_URL.CREATE_FAMILY_URL;
            ajaxPost(uri, familyDetails, (response) => {
                if (response.status === constants.STATUS_ACTIVE) {
                }
            });
        } else {
            Utils.showMessage('error', 'Please enter the details')
        }
    };

    staeChangeInName = (childFamilyData) => {
        this.setState( childFamilyData, ()=>{
        });
    };

    render() {
        return (
            <div>
                <MenuComponent/>
                <Jumbotron fluid>
                    <Container>
                        <h1>Add Family</h1>
                        <h5> Fill out this form to add families to FreshTrak .</h5>
                    </Container>
                </Jumbotron>
                <form onSubmit={this.handleSubmit}>
                    <Form.Group controlId="exampleForm.ControlInput1">
                        <div className="container">
                            <NameFormComponent onSelectedChild = {this.staeChangeInName}/>
                        </div>
                        <div className="container">
                            <AddressFormComponent onSelectedChild = {this.staeChangeInName} />
                        </div>
                        <div className="container">
                            <HousingTypeFormComponent onSelectedChild = {this.staeChangeInName} />
                        </div>
                        <div className="container">
                            <ZipFormComponent onSelectedChild = {this.staeChangeInName} />
                        </div>
                        <div className="container">
                            <ContactNumberFormComponent onSelectedChild = {this.staeChangeInName} />
                        </div>
                        <div className="container">
                            <DobFormComponent onSelectedChild = {this.staeChangeInName} />
                        </div>
                        <div className="container">
                            <MemberCountFormComponent onSelectedChild = {this.staeChangeInName} />
                        </div>
                        <Jumbotron fluid>
                            <Container>
                                <Button type="submit" variant="primary">Submit</Button>
                            </Container>
                        </Jumbotron>
                    </Form.Group>
                </form>
                <FooterComponent/>
            </div>

        )
    }
}
export default FamilyContainer;
